import json
import time

import requests
import matplotlib.pyplot as plt
import pandas as pd

def main():
    while True:
        url = f"https://kpb3.cls.cn/quote/stock/fundflow?symbol=sz002241"
        resp = requests.get(url).text
        with open("./data_sz.txt",mode="a+") as writer:
            writer.write(f"{resp}\n")
        time.sleep(2)


def unique():
    lines = []
    with open("./data_sz.txt") as reader:
        for ix,line in enumerate(reader):
            if line.strip():
                if ix ==0:
                    lines.append(json.loads(line))
                else:
                    d = json.loads(line)
                    if lines[-1]["data"]["datetime"] != d["data"]["datetime"]:
                        lines.append(d)
    larges_in,larges_out = [],[]
    supers_in,supers_out = [],[]
    pure = []
    for l in lines:
        pure.append(l["data"]["main_fund_diff"])
        # larges_out.append(l["data"]["large_fund_out"]+l["data"]["super_fund_out"])
        # supers_in.append(l["data"]["super_fund_in"])
        # supers_out.append(l["data"]["super_fund_out"])
    plt.plot(pure, label="larges_in", color="#F08080")
    print(pure[-1])
    # plt.plot(larges_out, label="larges_out", color="#0B7093")
    # plt.plot(supers_in, label="supers_in", color="#F04021")
    # plt.plot(supers_out, label="supers_out", color="#0B6093")
    plt.legend()
    plt.show()

    print()


if __name__ == '__main__':
    # main()
    unique()

